import React, { useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";

export default function Navbar({
  onSearch,
  walletAddress,
  onLogout,
  showAccountModal,
  setShowAccountModal,
}) {
  const navigate = useNavigate();
  const location = useLocation();
  const [search, setSearch] = useState("");

  const handleSearch = (e) => {
    e.preventDefault();
    onSearch(search);
  };

  // Center the text with flex, match style
  return (
    <nav
      style={{
        width: "100%",
        background: "#f3f2ef",
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
        padding: "0 32px",
        height: 64,
        fontFamily: "inherit",
        borderRadius: "0 0 18px 18px",
        marginTop: 16,
        marginBottom: 30,
        boxShadow: "0 3px 20px #0001",
      }}
    >
      <div style={{ display: "flex", gap: 38, alignItems: "center" }}>
        <NavbarButton active={location.pathname === "/inventory"} onClick={() => navigate("/inventory")}>INVENTORY</NavbarButton>
        <NavbarButton active={location.pathname === "/transfer"} onClick={() => navigate("/transfer")}>TRANSFER</NavbarButton>
        <NavbarButton active={location.pathname === "/about"} onClick={() => navigate("/about")}>ABOUT</NavbarButton>
      </div>
      <div
        style={{
          fontSize: 2 + "rem",
          fontWeight: 700,
          letterSpacing: 2,
          color: "#676660",
          textAlign: "center",
          flex: 1,
          marginLeft: -120, // shifts center so it's actually visually centered
        }}
      >
        1312
      </div>
      <div style={{ display: "flex", gap: 34, alignItems: "center" }}>
        {/* SEARCH */}
        <form style={{ display: "inline-flex" }} onSubmit={handleSearch}>
          <input
            type="text"
            value={search}
            placeholder="Search..."
            onChange={(e) => setSearch(e.target.value)}
            style={{
              background: "#ecebe7",
              border: "none",
              borderRadius: 7,
              padding: "7px 10px",
              outline: "none",
              fontSize: 15,
              marginRight: 2,
            }}
          />
          <button
            type="submit"
            style={{
              background: "none",
              border: "none",
              color: "#676660",
              fontWeight: 700,
              fontSize: 15,
              cursor: "pointer",
            }}
          >
            SEARCH
          </button>
        </form>
        <NavbarButton onClick={() => setShowAccountModal(true)}>ACCOUNT</NavbarButton>
        <NavbarButton onClick={onLogout}>LOG OUT</NavbarButton>
      </div>
      {/* ACCOUNT MODAL */}
      {showAccountModal && (
        <div
          style={{
            position: "fixed",
            left: 0,
            top: 0,
            zIndex: 99,
            width: "100vw",
            height: "100vh",
            background: "rgba(0,0,0,0.2)",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
          }}
          onClick={() => setShowAccountModal(false)}
        >
          <div
            style={{
              background: "#fff",
              padding: "38px 48px",
              borderRadius: 20,
              minWidth: 330,
              boxShadow: "0 8px 32px #2222",
              color: "#383838",
              position: "relative",
            }}
            onClick={(e) => e.stopPropagation()}
          >
            <div style={{ fontWeight: 600, fontSize: 19, marginBottom: 10 }}>Account</div>
            <div style={{ fontSize: 15, wordBreak: "break-all" }}>
              <b>Wallet Address:</b>
              <br />
              {walletAddress || <span style={{ color: "#aaa" }}>No wallet connected.</span>}
            </div>
            <button
              style={{
                position: "absolute",
                right: 18,
                top: 12,
                border: "none",
                background: "none",
                fontSize: 22,
                cursor: "pointer",
                color: "#aaa",
              }}
              onClick={() => setShowAccountModal(false)}
              aria-label="Close"
            >Ã—</button>
          </div>
        </div>
      )}
    </nav>
  );
}

function NavbarButton({ active, children, ...props }) {
  return (
    <button
      {...props}
      style={{
        background: "none",
        border: "none",
        fontWeight: 700,
        fontSize: 20,
        color: active ? "#262624" : "#706c67",
        cursor: "pointer",
        borderBottom: active ? "2.5px solid #706c67" : "2.5px solid transparent",
        padding: "0 0 3px 0",
        transition: "color .18s, border-bottom .18s",
        letterSpacing: 1.1,
      }}
    >
      {children}
    </button>
  );
}
